class Solution:
	# @param {string} s
	# @param {string[]} words
	# @return {integer[]}
	def findSubstring(self, s, words):
		#words = sorted(words)
		words_dict = dict(((x, words.count(x)) for x in set(words)))
		n = len(words)
		m = len(words[0])
		string_len = m*n
		match_index = []
		
		i = 0
		while string_len+i <= len(s):
			dict2 ={}
			item = s[i:(string_len+i)]
			
			count = 0
			for j in range(0,len(item),m):
				ele = item[j:(j+m)]
				if ele not in words_dict:
					break
				else:
					dict2[ele]=dict2.get(ele,0)+1  
					if dict2[ele] > words_dict[ele]:
						break
				count +=1
			if count == n:
				match_index.append(i)
			i+=1		
			
		return match_index


if __name__ == '__main__':
	s = ""
	words = ["dhvf","sind","ffsl","yekr","zwzq","kpeo","cila","tfty","modg","ztjg","ybty","heqg","cpwo","gdcj","lnle","sefg","vimw","bxcb"]
